import React, { useState } from "react";

const Login = () => {
  const [userType, setUserType] = useState("patient");

  return (
    <div className="login-container">
      <h2>{userType === "patient" ? "Patient Login" : "Doctor Login"}</h2>
      <button onClick={() => setUserType("patient")}>Patient</button>
      <button onClick={() => setUserType("doctor")}>Doctor</button>
      
      <form className="login-form">
        <input type="email" placeholder="Email" required />
        <input type="password" placeholder="Password" required />
        <button type="submit">{userType === "patient" ? "Login as Patient" : "Login as Doctor"}</button>
      </form>
    </div>
  );
};

export default Login;
